import React from 'react'
import Drawer from '@material-ui/core/Drawer/Drawer'

class SideMenu extends React.Component{

  constructor(props){
    super(props);
    this.state ={
      open: false
    }
  }



  render(){
    return(
      <div>
        <Drawer/>
      </div>
    )
  }
}

export default SideMenu
